There’s truly nothing quite like that feeling!!

Thank you to my team and everyone who helped make this dream a reality.

@marion_reneau is a legend of a woman and I was honored to share the Octagon with her last night. Best wishes in whatever your future may bring 🙏

For me this is just the beginning, I’m loving all the callouts! Feels good to be back 💪🧁😘

The water bottle belonged to my former coach Robert Follis who was with me in spirit every step of the way. I carried that bottle this whole camp. I miss you Rob #RIP

